import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Aplikacija za lov</h1>
        <div className="Menu">
          <Button text="EVIDENCIJA LOVACA" />
          <Button text="RASPORED AKTIVNOSTI I LOVA" />
          <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" />
          <Button text="UNOS DIVLJAČI" />
          <Button text="UNOS ODSTRIJELENE DIVLJAČI" />
          <Button text="BODOVI" />
          <router-link to="/bodovi" class="submit-btn register-btn" style="text-decoration: none;">Registracija</router-link>

        </div>
      </header>
    </div>
  );
}
function Button({ text }) {
  return (
    <div className="Button">
      {text}
    </div>
  );
}

export default App;
